import React from "react";
import { useTranslation } from "react-i18next";
import { Table } from "react-bootstrap";

import panbarra from "./Images/panbarra.jpeg";

const Principal = () => {
    const { t, i18n } = useTranslation();

    return (
        <div className="container mt-4">
            <div style={{ display: "flex", justifyContent: "center" }}>
                <div style={{ flex: 1, marginRight: "20px" }}>
                    <img src={panbarra} alt="Imagen" style={{ maxWidth: "100%", height: "auto" }} />
                </div>
                <div style={{ flex: 1 }}>
                    <p style={{ fontFamily: "Arial, sans-serif", fontSize: "18px", color: "#333", lineHeight: "1.5" }}>
                        <strong>¡Texto bonito aquí!</strong><br />
                        Este es un ejemplo de texto con un estilo más atractivo. Puedes personalizar el estilo como desees.
                    </p>
                </div>
            </div>
        </div>
    );
};

export default Principal;
